import logo from './logo.svg';
import './App.css';

let persons = [];
function App() {
  return (
    <div className="App">
      <header className="App-header">
        Cette application cherche des personnes
      </header>
      <button onClick={getPersons()}>Appuyer ici pour avoir quelques personnes</button>
      <table>
        <tr>
          <td>Pr√©nom</td>
          <td>Nom</td>
          <td>Date de naissance</td>
          <td>Sexe</td>
        </tr>
        {
          persons.map(person => <tr>
            <td>{person.prenom}</td>
            <td>{person.nom}</td>
            <td>{person.dateNaissance}</td>
            <td>{person.Sexe}</td>
          </tr>)
        }
      </table>
    </div>
  );
}


function getPersons() {
  return fetch("localhost:8082/persons").then((response) => response.json())
  .then(jsonResponse => persons = jsonResponse.data);
}
export default App;
